import React, { Component } from "react";
import Info from "./memberInfo";
class ListButton extends Component {
  constructor() {
    super();
    this.state = { infoItem: null ,number:1};
    this.clickEvent = this.clickEvent.bind(this);
  }
  clickEvent() {
    while(this.state.number!==Info.length){
    this.setState((previousNumber) => {
      return { number: previousNumber.number + 1 };
    });
   let member= Info.map((member)=>{return member[this.state.number]})
   console.log(member);
   return member;}
  }
  render() {
    return (
      <div>
        <button type="button" class="btn btn-info" onClick={this.clickEvent}>
          {this.clickEvent()['key']}...................................
        </button>
      </div>
    );
  }
}
export default ListButton;
